import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { NavComponent } from './Components/nav/nav.component';
import { MainHeroComponent } from './Components/main-hero/main-hero.component';
import { CardGridComponent } from './Components/card-grid/card-grid.component';
import { CardGalleryComponent } from './Components/card-gallery/card-gallery.component';
import { DivderComponent } from './Components/divder/divder.component';

@NgModule({
  declarations: [
    AppComponent,
    NavComponent,
    MainHeroComponent,
    CardGridComponent,
    CardGalleryComponent,
    DivderComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
